import { Link } from 'react-router-dom';

const PRODUCTS = [
  { id: 'p1', title: 'Product 1', description: 'The first product' },
  { id: 'p2', title: 'Product 2', description: 'The second product' },
  { id: 'p3', title: 'Product 3', description: 'The third product' },
];

function ProductsPage() {
  return (
    <div>
      <h1>Product Page</h1>
        <ul>
          <li><Link to="/products/product-1">Product 1</Link></li>
          <li><Link to="/products/product-2">Product 2</Link></li>
          <li><Link to="/products/product-3">Product 3</Link></li>
        </ul>
    </div>
  );
}


export default ProductsPage;
